description.text:
Through hole tactile switch based on CTS 222A tactile switch<br />
<a rel="nofollow" href="http://www.mouser.com/ds/2/96/222A-531986.pdf" >http://www.mouser.com/ds/2/96/222A-531986.pdf</a>
This object is intended to be imported into other projects:
<code >use &lt;/path/to/library/tactile_switch.scad&gt;

switchLocations = [[0, 0, 0], [0, 5, 0], [5, 5, 0]];

for (i = switchLocations) {
   translate(i)
   tactileSwitch(center = false, locate = false);
} </code>
center = true will center around the volume of the switch base<br />
center = false will place the bottom of the switch at the origin
locate = true adds a spear to make locating the switch easier when using it in models
Updates can be found at GitHub:<br />
<a rel="nofollow" href="https://github.com/txoof/OpenSCAD_electronics" >https://github.com/txoof/OpenSCAD_electronics</a>

